import React from 'react';
import ReactDOM from 'react-dom';
import App from './'; // Adjust the path based on your actual file structure
import UserSettingsProvider from './src/UserSettingsProvider';
import withTimeTracking from './src/withTimeTracking';

const AppWithTimeTracking = withTimeTracking(App);

ReactDOM.render(
  <React.StrictMode>
    <UserSettingsProvider>
      <AppWithTimeTracking />
    </UserSettingsProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
